import React from "react";
import './App.css';
import Header from './Header';
import Sidebar from "./Sidebar";
import Feed from "./Feed";
import Widgets from "./Widgets";

function App() {
  return (
    // BEM naming convention
    <div className="app">

      <Header/>

      <div className="app__body">
      <Sidebar />
      <Feed/>
      <Widgets/>
      </div>
    </div>
  );
}

export default App;
